//react패키지에서 리액트 가져온다.
import React from "react";
import "./style.css";


const StarPage = (props) => {


    //console.log(props);

    return (
        <div>

            <h3><span className="day">{props.name}</span> 평점 남기기</h3>

            <div className="weeks-list">일
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
            </div>

            <button className="btn">평점 남기기</button>

        </div>
    );
}


//만든 컴포넌트를 다른 파이에서도 불러다가 쓸 수 있도록 export해줌!
